import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';

function Step5(props) {

  return (
    <div className='quote'>
      <button onClick={() => props.history.push('/step4')}>go back</button>
      <button onClick={() => props.history.push('/step6')}>go to step 6</button>

    </div>
  );
}

export default connect()(withRouter(Step5));
